import React, { Component } from 'react';
import './App.css';
import Pokemon from './liste/Pokemons';
import './liste/style.css'

class App extends Component {

    render() {
        const url=window.location.pathname;
    return (
        <div className="App">
              <h2> Pokedex</h2>
            <br></br>
            {url}
            <Pokemon />
        </div>
    );
  }
}

export default App;
